import { createApp } from 'vue'
import App from './App.vue'
import './index.css'
import anime from 'animejs/lib/anime.es.js';

createApp(App).mount('#app')

/* ANIMATIONS */

anime({
    targets: '.text-title',
    translateX: 250,
    rotate: '1turn',
    duration: 800
});
